import React from "react";
import Header from "./Header";
import PropTypes from "prop-types";

function Page({ children }) {
	return (
		<div>
			<Header />
			{children}
		</div>
	);
}

export default Page;

Page.protoType = {
	children: PropTypes.any,
	/*
    children: PropTypes.oneOf([
		PropTypes.arrayOf(PropTypes.node),
		PropTypes.node,
	]),
    */
};
